import classes from './Card.module.css'
import { Link } from 'react-router-dom';
const Card = (props) => {

    return (
        <div className={classes.card}>

            <h3 as={Link} to='auth'>{props.title}</h3>

            <p>{props.location}</p>
            <p>{props.type}</p>
            <p>{props.description}</p>
        </div>
    )

}


export default Card
